import '../../data/models/tabs_and_total_loans_dto.dart';class TabsAndTotalLoans {  TabsAndTotalLoans({    this.totalLoans,    this.tabLoans,  });  List<TotalLoans>? totalLoans;  List<TabLoans>? tabLoans;  factory TabsAndTotalLoans.fromDto(TabsAndTotalLoansDto json) {    return TabsAndTotalLoans(      totalLoans: json.totalLoans?.map((e) => TotalLoans.fromDto(e)).toList(),      tabLoans: json.tabs?.map((e) => TabLoans.fromDto(e)).toList(),    );  }}class TabLoans {  TabLoans({    this.name,    this.value,  });  String? name;  int? value;  factory TabLoans.fromDto(TabLoansDto json) {    return TabLoans(      name: json.name,      value: json.value,    );  }}class TotalLoans {  TotalLoans({    this.label,    this.value,    this.icon,  });  String? label;  num? value;  String? icon;  factory TotalLoans.fromDto(TotalLoanDto json) {    return TotalLoans(      label: json.label,      value: json.value,      icon: json.icon,    );  }}